import React from 'react';
import styled from 'styled-components';
import { Link, useNavigate } from 'react-router-dom';
const HeaderContainer = styled.header`
  background-color: #4B627B;
  width: 100%;  /* Ensure the header spans the full width */
  min-height: 10vh;
  display: flex;
  align-items: center;
  justify-content: space-between; /* Space out items */
  padding: 0 20px;
  font-size: calc(10px + 2vmin);
  color: white;
`;

const LogoContainer = styled.div`
  display: flex;
  align-items: center;
`;

const Logo = styled.img`
  height: 60px;  /* Adjust the height as needed */
  margin-left: 10px;
`;

const Title = styled.h1`
  display: flex;
  align-items: center;
  margin: 0;
  font-size: 2rem; /* Adjust the font size as needed */
`;

const NavLinks = styled.div`
  display: flex;
  align-items: center;
`;

const NavLink = styled(Link)`
  color: white;
  text-decoration: none;
  margin-left: 20px;
  font-size: 1.2rem;
  &:hover {
    text-decoration: underline;
  }
`;

const LogoutButton = styled.button`
  background-color: #011E3E;
  color: white;
  border: none;
  border-radius: 4px;
  padding: 10px 20px;
  cursor: pointer;
  font-size: 1rem;
  margin-left: 20px;
  &:hover {
    background-color: #003366;
  }
`;

const Header = ({ isAuthenticated, onLogout }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    onLogout();
    navigate('/');
  };

  return (
    <>
      <HeaderContainer>
        <LogoContainer>
          <Title>
            PrețMonitor
            <Logo src="/logo.png" alt="PrețMonitor Logo" />
          </Title>
        </LogoContainer>
        {isAuthenticated && (
          <NavLinks>
            <NavLink to="/produsele-tale">Produsele tale</NavLink>
            <NavLink to="/adauga-produs">Adaugă produs</NavLink>
            <LogoutButton onClick={handleLogout}>Delogare</LogoutButton>
          </NavLinks>
        )}
      </HeaderContainer>
    </>
  );
};

export default Header;
